import React, { useState } from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';

function CreateCustomer() {
  const[displayCustomerId, setdisplayCustomerId] = useState("")
  const[firstName, setFirstName] = useState("")
  const[lastName, setLastNamed] = useState("")
  const[dob, setDob] = useState("")
  const[gender, setGender] = useState("")
  const[mobileNo, setMobileNo] = useState("")
  const[emailId, setEmailId] = useState("")
  const[address, setAddress] = useState("")
  const[district, setDistrict] = useState("")
  const[state, setState] = useState("")
  const[country, setCountry] = useState("")
  const[pinCode, setPinCode] = useState("")

 
  const history = useNavigate();

  const handlesubmit = (e)=>{
    e.preventDefault();
    console.log("onclick");
    axios.post('https://659bdc86d565feee2dabe1eb.mockapi.io/crm',
              { displayCustomerId,
                firstName,
                 lastName,
                 dob,
                 gender,
                 mobileNo,
                 emailId,
                 address,
                 district,
                 state,
                 country,
                 pinCode,
              })
              .then(()=>{
                history("/readCustomer")
              });
  };

  return (
    <div>
    <Form>
      <div className="mb-3">
        <div className="d-flex justify-content-between m-3">
        <h2>Create New </h2>
        <Link to = "/readCustomer">
        <Button variant="primary">Show data</Button>
        </Link>
        </div>
        <div>
        <label>display_customer_id</label>
        <input type="text" onChange={(e)=>setDisplayCustomerId(e.target.value)}/>
        </div>
        <div>
        <label>first_name</label>
        <input type="text" onChange={(e)=>setFirstName(e.target.value)} />
        </div>
        <div>
        <label>last_name</label>
        <input type="text" onChange={(e)=>setLastNamed(e.target.value)}/>
        </div>
        <div>
        <label>dob</label>
        <input type="text" onChange={(e)=>setDob(e.target.value)} />
        </div>
        <div>
        <label>gender</label>
        <input type="emtextail" onChange={(e)=>setGender(e.target.value)}/>
        </div>
        <div>
        <label>mobile_no</label>
        <input type="text" onChange={(e)=>setMobileNo(e.target.value)} />
        </div>
        <div>
        <label>email_id</label>
        <input type="email" onChange={(e)=>setEmailId(e.target.value)}/>
        </div>
        <div>
        <label>address</label>
        <input type="text" onChange={(e)=>setAddress(e.target.value)} />
        </div>
        <div>
        <div>
        <label>district</label>
        <input type="text" onChange={(e)=>setDistrict(e.target.value)} />
        </div>
        <div>
        <label>state</label>
        <input type="emtextail" onChange={(e)=>setState(e.target.value)}/>
        </div>
        <div>
        <label>country</label>
        <input type="text" onChange={(e)=>setCountry(e.target.value)} />
        </div>
        <div>
        <label>pin_code</label>
        <input type="number" onChange={(e)=>setPinCode(e.target.value)} />
        </div>
        <Button type="submit" onClick={handlesubmit}>submit</Button>
      </div>
      </div>
    </Form>
    </div>
  );
}
export default CreateCustomer;
